/**/
/* woocommerce_price_slider */
/**/
function woocommerce_price_slider() {
  var current_min_price;
  var current_max_price;
  window.woocommerce_price_slider_params = {
    'currency_pos': 'right',
    'currency_symbol': '<sup>$</sup>'

    // woocommerce_price_slider_params is required to continue, ensure the object exists
  };if (typeof woocommerce_price_slider_params === 'undefined') {
    return false;
  }
  // Get markup ready for slider
  $('input#min_price, input#max_price').hide();
  $('.price_slider, .price_label').show();

  // Price slider uses jquery ui
  var min_price = $('.price_slider_amount #min_price').data('min'),
      max_price = $('.price_slider_amount #max_price').data('max');

  current_min_price = parseInt(min_price, 10);
  current_max_price = parseInt(max_price, 10);

  if (woocommerce_price_slider_params.min_price) current_min_price = parseInt(woocommerce_price_slider_params.min_price, 10);
  if (woocommerce_price_slider_params.max_price) current_max_price = parseInt(woocommerce_price_slider_params.max_price, 10);
  $('body').on('price_slider_create price_slider_slide', function (event, min, max) {
    if (woocommerce_price_slider_params.currency_pos === 'left') {

      $('.price_slider_amount span.from').html(woocommerce_price_slider_params.currency_symbol + min);
      $('.price_slider_amount span.to').html(woocommerce_price_slider_params.currency_symbol + max);
    } else if (woocommerce_price_slider_params.currency_pos === 'left_space') {

      $('.price_slider_amount span.from').html(woocommerce_price_slider_params.currency_symbol + " " + min);
      $('.price_slider_amount span.to').html(woocommerce_price_slider_params.currency_symbol + " " + max);
    } else if (woocommerce_price_slider_params.currency_pos === 'right') {

      $('.price_slider_amount span.from').html(min + woocommerce_price_slider_params.currency_symbol);
      $('.price_slider_amount span.to').html(max + woocommerce_price_slider_params.currency_symbol);
    } else if (woocommerce_price_slider_params.currency_pos === 'right_space') {

      $('.price_slider_amount span.from').html(min + " " + woocommerce_price_slider_params.currency_symbol);
      $('.price_slider_amount span.to').html(max + " " + woocommerce_price_slider_params.currency_symbol);
    }

    $('body').trigger('price_slider_updated', min, max);
  });

  $('.price_slider').slider({
    range: true,
    animate: true,
    min: min_price,
    max: max_price,
    values: [current_min_price, current_max_price],
    create: function create(event, ui) {

      $('.price_slider_amount #min_price').val(current_min_price);
      $('.price_slider_amount #max_price').val(current_max_price);

      $('body').trigger('price_slider_create', [current_min_price, current_max_price]);
    },
    slide: function slide(event, ui) {

      $('input#min_price').val(ui.values[0]);
      $('input#max_price').val(ui.values[1]);

      $('body').trigger('price_slider_slide', [ui.values[0], ui.values[1]]);
    },
    change: function change(event, ui) {

      $('body').trigger('price_slider_change', [ui.values[0], ui.values[1]]);
    }
  });
};

/**/
/* Wrap this */
/**/
$.fn.WrapThis = function (arg1, arg2) {
  /*=Takes 2 arguments, arg1 is how many elements to wrap together, arg2 is the element to wrap*/

  var wrapClass = "column"; //=Set class name for wrapping element

  var itemLength = $(this).find(arg2).length; //=Get the total length of elements
  var remainder = itemLength % arg1; //=Calculate the remainder for the last array
  var lastArray = itemLength - remainder; //=Calculate where the last array should begin

  var arr = [];

  if ($.isNumeric(arg1)) {
    $(this).find(arg2).each(function (idx, item) {
      var newNum = idx + 1;

      if (newNum % arg1 !== 0 && newNum <= lastArray) {
        arr.push(item);
      } else if (newNum % arg1 == 0 && newNum <= lastArray) {
        arr.push(item);
        var column = $(this).pushStack(arr);
        column.wrapAll('<div class="' + wrapClass + '"/>'); //=If the array reaches arg1 setting then wrap the array in a column
        arr = [];
      } else if (newNum > lastArray && newNum !== itemLength) {
        //=If newNum is greater than the lastArray setting then start new array of elements
        arr.push(item);
      } else {
        //=If newNum is greater than the length of all the elements then wrap the remainder of elements in a column
        arr.push(item);
        var column = $(this).pushStack(arr);
        column.wrapAll('<div class="' + wrapClass + '"/>');
        arr = [];
      }
    });
  }
};

/**/
/* MARK */
/**/
function star_rating() {
  var stars_active = false;
  var mark;
  var rating;

  $(".woocommerce .stars").on("mouseover", function () {
    if (!stars_active) {
      $(this).find("span:not(.stars-active)").append("<span class='stars-active' data-set='no'>&#xf005;&#xf005;&#xf005;&#xf005;&#xf005;</span>");
      stars_active = true;
    }
  });
  $(".woocommerce .stars").on("mousemove", function (e) {
    var cursor = e.pageX;
    var ofs = $(this).offset().left;
    var fill = cursor - ofs;
    var width = $(this).width();
    var persent = Math.round(100 * fill / width);

    $(".woocommerce .stars span a").css({ "line-height": String((width + 1) / 5) + "px", "width": String(width / 5) + "px" });
    $(".woocommerce .stars span .stars-active").css("margin-top", "0px");
    $(this).find(".stars-active").css('width', String(persent) + "%");
    $(".stars-active").removeClass("fixed-mark");
  });
  $(".woocommerce .stars").on("click", function (e) {
    var cursor = e.pageX;
    var ofs = $(this).offset().left;
    var fill = cursor - ofs;
    var width = $(this).width();
    var persent = Math.round(100 * fill / width);

    mark = $(this).find(".stars-active");
    mark.css('width', String(persent) + "%").attr("data-set", String(persent));
    rating = $(this).closest('#respond').find('#rating');
    rating.val($($(this).find("span a[class*='star-']")[Math.ceil(persent.toFixed(2) / 20) - 1]).text());
  });
  $(".woocommerce .stars").on("mouseleave", function (e) {
    if ($(mark).attr("data-set") == "no") {
      mark.css("width", "0");
    } else {
      var persent = $(mark).attr("data-set");
      $(mark).css("width", String(persent) + "%");
      $(".stars-active").addClass("fixed-mark");
    }
  });
}

/**/
/* woocommerce button add */
/**/
function woocommerce_button_add() {

  // Orderby
  $('.woocommerce-ordering').on('change', 'select.orderby', function () {
    $(this).closest('form').submit();
  });

  // Quantity buttons
  $('div.quantity:not(.buttons_added), td.quantity:not(.buttons_added)').addClass('buttons_added').append('<input type="button" value="+" class="plus" />').prepend('<input type="button" value="-" class="minus" />');

  // Target quantity inputs on product pages
  $('input.qty:not(.product-quantity input.qty)').each(function () {
    var min = parseFloat($(this).attr('min'));

    if (min && min > 0 && parseFloat($(this).val()) < min) {
      $(this).val(min);
    }
  });

  $(document).on('click', '.plus, .minus', function () {

    // Get values
    var $qty = $(this).closest('.quantity').find('.qty'),
        currentVal = parseFloat($qty.val()),
        max = parseFloat($qty.attr('max')),
        min = parseFloat($qty.attr('min')),
        step = $qty.attr('step');

    // Format values
    if (!currentVal || currentVal === '' || currentVal === 'NaN') currentVal = 0;
    if (max === '' || max === 'NaN') max = '';
    if (min === '' || min === 'NaN') min = 0;
    if (step === 'any' || step === '' || step === undefined || parseFloat(step) === 'NaN') step = 1;

    // Change the value
    if ($(this).is('.plus')) {

      if (max && (max == currentVal || currentVal > max)) {
        $qty.val(max);
      } else {
        $qty.val(currentVal + parseFloat(step));
      }
    } else {

      if (min && (min == currentVal || currentVal < min)) {
        $qty.val(min);
      } else if (currentVal > 0) {
        $qty.val(currentVal - parseFloat(step));
      }
    }
    // Trigger change event
    $qty.trigger('change');
  });
};

